// And groups predicates with the AND operator between them.
func And(predicates ...predicate.IdentityHolder) predicate.IdentityHolder {
	return predicate.IdentityHolder(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.IdentityHolder) predicate.IdentityHolder {
	return predicate.IdentityHolder(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.IdentityHolder) predicate.IdentityHolder {
	return predicate.IdentityHolder(sql.NotPredicates(p))
}
